import { useState} from "react";
import data from "../data.js";


function Main (){

    return(
    <div>
    <h1>심리테스트</h1>
    {
    data.map(function(test){
        return(
            <h4> {test.text} </h4>
            
        )
        
    })}
        
    </div>
    )
}

function Modal(){
    return(
      <div>
        아니다 그저그렇다 그렇다
      </div>
    )
  }

export default Main;
